I attach the same MouseTrackAdapter to several Controls (e.g., the Composite that contains a Button and a text, and the Button, and the Text), set to make the Text visible (and with updated text) upon hover. This works fine with Button and Composite, but the Text never responds (acc. to syserr in the mouseHover() method).

See the code below; pass new Control[] { container, button, text }.

Compare bugs 71908 and 17871. 

==================== 

public abstract class GuideTextTracker extends MouseTrackAdapter {

	/**
	 * Style bits for a Text performing info-display. 
	 */
	public static final int INFO_STYLE = 
		SWT.LEAD | SWT.MULTI | SWT.READ_ONLY | SWT.WRAP;

	/**
	 * Create the GuideTextTracker for the given Text 
	 * @param controls Control[] to which to attach 
	 * @param text Text 
	 */
	protected GuideTextTracker(final Control[] controls, final Text text) { 
		_text = text;
		_container = _text.getParent(); 

		// if these controls get disposed, the mouse won't track on them, 
		// ergo no need to arrange disposal of this listener 
		for (final Control control : controls) {
			control.addMouseTrackListener(this); 
		}

		final int color = SWT.COLOR_INFO_BACKGROUND; 
		_text.setBackground(WorkbenchOps.systemColor(color)); 
		_text.setVisible(false); 
	}

	@Override
	public void mouseHover(MouseEvent e) {
		_text.setText(computeGuideText()); 
		final int fg = isWarning() ? SWT.COLOR_RED : SWT.COLOR_BLACK; 
		_text.setForeground(WorkbenchOps.systemColor(fg)); 
		_text.setVisible(true); 
		_container.layout(); 
	}

	@Override
	public void mouseExit(MouseEvent e) {
		_text.setVisible(false); 
	}

	/**
	 * @return boolean <code>true</code> iff the guide contains a warning, 
	 * and so should be in red. 
	 */
	protected boolean isWarning() { 
		return false; 
	}

	/**
	 * @return String to use as the guide. 
	 */
	protected abstract String computeGuideText(); 

	protected final Text _text;
	protected final Composite _container;
}

During our semantic model creation commands we access (WTP) EditModels that need to be released when they are finished being used. We do this in the dispose() method of our commands. However, these methods are not being called in some cases leading to EditModels with open locks. This causes DANGLING_REFERENCE exceptions on these EditModels. 

My team debugged this, and found that dispose() events were not being propogated properly on 2 critical command wrapper classes in GMF: SemanticCreateCommand, and ICommandProxy. 

We need these dispose() events to be called on their wrapped child when the receive them. Here is a possible way of implementing this that has been tested by my team and works.

ICommandProxy:

public void dispose() {
  super.dispose();
  getICommand().dispose();
 }

SemanticCreateCommand:

public void dispose() {
  realSemanticCommand.dispose();
  super.dispose();
 }

This causes several defects in our code and is blocking our test execution scenerios.

I have found that the class ModuleCoreNature has two methods that are catching exceptions incorrectly.  The methods getArtifactEditModelForRead and getArtifactEditModelForWrite both contain
try {
  IProjectFacet facet = ProjectFacetsManager.getProjectFacet(editModelIDs[i]);
	if (facet != null && facetedProject.hasProjectFacet(facet)) {
		ArtifactEditModel editModel = (ArtifactEditModel) getEditModelForRead(editModelIDs[i], anAccessorKey, params);
		if (editModel !=null) return editModel;
	}
} catch (Exception e) {
	continue;
}

the catch Exception is intended to be used as coding logic to handle the ProjectFacetsManager behavior.  This is fine except that the getEditModelForRead could possibly through the ClientAccessRegistryException for exposing leaking models.  Catching the exception in the current manner hides that information from the developer and then results in an anonymous null pointer being thrown when the model is finally accessed.  The getEditModel method should be wrapped with its own try catch block like
try {
	ArtifactEditModel editModel = (ArtifactEditModel) getEditModelForWrite(editModelIDs[i], anAccessorKey, params);
	if (editModel !=null)
		return editModel;
}catch (ClientAccessRegistryException care) {
	ModulecorePlugin.log(0,0,"MESSAGE",care );
}

